import {yet} from './Info';

const Gallary=()=>{
    return(
        <>
            <div className="row justify-content-center">
                <div className="card col">
                    <img className="card-image" src={fort} />
                    <h1 className="display-7 text-primary">{yet[0].title}</h1>
                </div>
            </div>
        </>
    )
}

export default Gallary;
